import React from "react";
import { IonPage, IonHeader, IonToolbar, IonTitle } from "@ionic/react";

import CanvasJSReact from "../external-libs/canvasjs.react";

interface registoAvaliacao {
    data: Date,
    peso: number
}

class Evolucao extends React.Component {

    state: {
        values: Array<registoAvaliacao>
    }

    constructor(props: any) {

        super(props);        

        this.state = ({
            values: new Array<registoAvaliacao>()
        });
    }

    componentDidMount() {

        this.state.values.push({data: new Date(2020, 0, 2), peso: 98});
        this.state.values.push({data: new Date(2020, 3, 25), peso: 95});
        this.state.values.push({data: new Date(2020, 6, 11), peso: 87});
        this.state.values.push({data: new Date(2020, 9, 9), peso: 86});
        this.state.values.push({data: new Date(2020, 12, 23), peso: 86});
    }

    render() {

        const options = {

            animationEnabled: true,
            title: {
                text: "Evolução do peso (em kg)"
            },
            axisX: {
				valueFormatString: "MMM"
			},
			axisY: {
                title: "Peso (kg)",
                sufix: "kg",
				includeZero: false
            },
            data: [{
				yValueFormatString: "###",
				xValueFormatString: "MMMM",
				type: "spline",
				dataPoints: this.state.values.values
			}]

        }

        return(

            <IonPage>

                <IonHeader>
                    <IonToolbar color="primary">
                        <IonTitle id="page-title">Evolução</IonTitle>
                    </IonToolbar>
                </IonHeader>
            <div>
                <CanvasJSReact.CanvasJSChart options = {options} />
            </div>

            </IonPage>

        );
    }

}

export default Evolucao;
